    "2016-05-08T00:33:23.462336",nt"name": "provider-of-services-file-2c7b0",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The POS file consists of two data files,
    one for CLIA labs and one for 18 other provider types. The file names are CLIA and
    OTHER. If downloading the file, note it is fairly large (125MB in CSV). The POS
    Extract is created from the QIES (Quality Improvement Evaluation System) database.
    These data include provider number, name, and address and characterize the participating
    institutional providers. The data are collected through the Centers for Medicare
    and Medicaid Services (CMS) Regional Offices. The file contains an individual record
    for each Medicare-approved provider and is updated quarterly. For a list of provider
    types, layout files, and how to order previous annual files, please see the Source
    Link in the About tab.</p>n",nt"license_title": "Other License Specified",nt"extras":
